export default class Home extends Component {
    constructor(props) {
        super(props);
        this.state = {
            currentCategoryIndex: 0,
            category: tempItems_all,
            filterCategory: filterCategory,
            filterBreed: filterBreed,
            filterPet: filterPet
        }
        this.allPets = [tempItems_all, tempItems_dog, tempItems_cat, tempItems_parrot];
    }

    categorySeleted = (index) => {
        let filterCategory = this.state.filterCategory;
        filterCategory.forEach(item => {
            if (item.index == index)
                item.is_selected = true;
            else
                item.is_selected = false;
        });
        this.setState({
            filterCategory: filterCategory,
            category: this.allPets[index]
        })
    }

    breedSeleted = (index) => {
        let filterBreed = this.state.filterBreed;
        filterBreed.forEach(item => {
            if (item.index == index)
                item.is_selected = true;
            else
                item.is_selected = false;
        });
        this.setState({
            filterBreed: filterBreed,
        })
    }

    petSelected = (index) => {
        let filterPet = this.state.filterPet;
        filterPet.forEach(item => {
            if (item.index == index)
                item.is_selected = true;
            else
                item.is_selected = false;
        });
        this.setState({
            filterPet: filterPet,
        })
    }

    setCategoryFav = (item, value) => {
        let category = this.state.category;
        category[item.index].is_fav = value;
        this.setState({ category: category });
    }

    renderItem = ({ item }) => {
        return (
            <TouchableOpacity style={{ flex: 1, flexDirection: "row", marginBottom: 20 }} activeOpacity={0.8} onPress={() => this.props.navigation.navigate("AdDetail", { item: item })}>
                <View>
                    <Image
                        source={{ uri: item.image }}
                        style={{ width: 120, height: "100%", borderRadius: 5 }}
                        placeholder={<ActivityIndicator size={20} color={BaseColor.primaryColor}></ActivityIndicator>}></Image>
                </View>
                <View style={{ flexDirection: "column", flex: 1, paddingLeft: 10, justifyContent: "center", alignItems: "flex-start" }}>
                    <Text style={{ color: "grey", fontSize: 10 }}>Category</Text>
                    <Text style={{ color: BaseColor.primaryColor }}>{item.category}</Text>
                    <Text style={{ color: "grey", fontSize: 10 }}>Breed</Text>
                    <Text>{item.breed}</Text>
                    <Text style={{ color: "grey", fontSize: 10 }}>Age</Text>
                    <Text>{item.age} Years</Text>
                    <Text style={{ color: "grey", fontSize: 10 }}>Location</Text>
                    <Text>{item.location}</Text>
                </View>
                <View style={{ flexDirection: "column", paddingLeft: 10, }}>
                    <Text style={{ color: "grey", fontSize: 10 }}>{item.requestNum} requestes, {item.latestTime}</Text>
                    <Text style={{ fontSize: 20, textAlign: "right" }}>$ {item.price}</Text>
                    {item.is_fav ?
                        <TouchableOpacity onPress={() => this.setCategoryFav(item, false)} style={{ position: "absolute", bottom: 0, right: 0 }}>
                            <Icon name={"heart"} size={20} color={BaseColor.primaryColor} solid></Icon>
                        </TouchableOpacity>
                        :
                        <TouchableOpacity onPress={() => this.setCategoryFav(item, true)} style={{ position: "absolute", bottom: 0, right: 0 }}>
                            <Icon name={"heart"} size={20} color={BaseColor.primaryColor} ></Icon>
                        </TouchableOpacity>
                    }
                </View>
            </TouchableOpacity>
        )
    }

    render = () => {
        return (
            <View style={{ flex: 1, zIndex: -1 }}>
                <Header navigation={this.props.navigation} mainHeader={true} />
                <View style={{ flexDirection: "row", width: "100%", height: 40, paddingHorizontal: 10, alignItems: "center", justifyContent: "center" }}>
                    <View style={{ borderRadius: 5, height: 40, flex: 1, backgroundColor: BaseColor.primaryColor }}>
                        <TextInput style={{ flex: 1, paddingLeft: 45, paddingRight: 20, color: "white" }} placeholder={"Search"} placeholderTextColor={"#fff"}></TextInput>
                        <TouchableOpacity style={{ position: "absolute", left: 10, top: 10 }}>
                            <Icon name={"search"} size={20} color={BaseColor.whiteColor}></Icon>
                        </TouchableOpacity>
                    </View>
                    <TouchableOpacity onPress={() => this.RBSheetRef.open()} style={{ backgroundColor: BaseColor.primaryColor, width: 40, height: 40, marginLeft: 10, alignItems: "center", borderRadius: 5, justifyContent: "center", padding: 5 }}>
                        <Icon name={"sliders-h"} size={20} color={BaseColor.whiteColor}></Icon>
                    </TouchableOpacity>
                </View>
                <View style={{ flexDirection: "row", marginHorizontal: 10, marginTop: 10, justifyContent: "center", alignItems: "center" }}>
                    <Text style={{ color: BaseColor.primaryColor, fontSize: 20, flex: 1, fontWeight: "600" }}>Category of Pets</Text>
                    <TouchableOpacity style={{ marginLeft: 10, marginTop: 10 }}>
                        <Text style={{ color: BaseColor.primaryColor, fontSize: 13 }}>Show All</Text>
                    </TouchableOpacity>
                </View>
                <View style={{ width: "100%", height: 50, paddingHorizontal: 10, flexDirection: "row", marginTop: 10 }}>
                    {this.state.filterCategory.map((item, index) => (
                        <TouchableOpacity key={index} activeOpacity={1} onPress={() => this.categorySeleted(item.index)} style={{ flex: 1, justifyContent: "center", alignItems: "center", backgroundColor: item.is_selected ? BaseColor.primaryColor : "white", height: 40, borderRadius: 5 }}>
                            <Text style={{ color: !item.is_selected ? BaseColor.primaryColor : "white" }}>{item.title}</Text>
                        </TouchableOpacity>
                    ))}
                </View>
                <Text style={{ color: BaseColor.primaryColor, fontSize: 20, fontWeight: "600", marginLeft: 10 }}>Latest</Text>
                <FlatList
                    style={{ paddingHorizontal: 10, marginTop: 10 }}
                    keyExtractor={(item, index) => index.toString()}
                    data={this.state.category}
                    renderItem={this.renderItem}
                >
                </FlatList>

                <RBSheet
                    ref={ref => {
                        this.RBSheetRef = ref;
                    }}
                    height={Dimensions.get("screen").height / 5 * 3}
                    openDuration={250}
                    customStyles={{
                        container: {
                            justifyContent: "center",
                            alignItems: "center",
                            borderTopLeftRadius: 30, borderTopRightRadius: 30
                        }
                    }}>

                    <View style={{ flex: 1, padding: 20 }}>
                        <View style={{ justifyContent: "center", alignItems: "center" }}>
                            <View style={{ width: 120, height: 8, backgroundColor: "grey", borderRadius: 100 }}></View>
                        </View>
                        <Text style={{ fontSize: 20, color: BaseColor.primaryColor, paddingVertical: 10, fontWeight: "bold" }}>Pet</Text>
                        <View style={{ flexDirection: "row", width: "100%" }}>
                            {this.state.filterPet.map((item, index) => (
                                <TouchableOpacity activeOpacity={1} onPress={() => this.petSelected(item.index)} style={{ flex: 1, justifyContent: "center", alignItems: "center", backgroundColor: item.is_selected ? BaseColor.primaryColor : "white", height: 40, borderRadius: 5 }}>
                                    <Text style={{ color: !item.is_selected ? BaseColor.primaryColor : "white" }}>{item.title}</Text>
                                </TouchableOpacity>
                            ))}
                        </View>
                        <Text style={{ fontSize: 20, color: BaseColor.primaryColor, paddingVertical: 10, fontWeight: "bold" }}>Breed</Text>
                        <View style={{ flexDirection: "row", width: "100%", marginTop: 10 }}>
                            {this.state.filterBreed.map((item, index) => (
                                <TouchableOpacity activeOpacity={1} onPress={() => this.breedSeleted(item.index)} style={{ flex: 1, justifyContent: "center", alignItems: "center", backgroundColor: item.is_selected ? BaseColor.primaryColor : "white", height: 40, borderRadius: 5 }}>
                                    <Text style={{ color: !item.is_selected ? BaseColor.primaryColor : "white" }}>{item.title}</Text>
                                </TouchableOpacity>
                            ))}
                        </View>
                    </View>
                </RBSheet>
            </View>
        )
    }
}